import SignInPage from "views/account/Login.jsx"
import SignUpPage from "views/account/Register.jsx"
import Start from "views/Start.jsx";
import Wizard from "views/about/Index.jsx"
import ProjectPage from "views/projects/Index.jsx"
import Timeline from "views/timeline/Index.jsx"
import Guides from "views/guides/Index.jsx"
import AdminProjectPage from "views/admin/AdminProjects.jsx"

//import UnderConstruction from "views/UnderConstruction.jsx";


//EXPORTED ROUTES FOR INAPP USE
export const START_PAGE = '/home/start';
export const REGISTER ='auth/register';
;
export const LOGIN = '/auth/login';
export const USER_PROFILE = '/home/userprofile';
export const ADMIN_USER = '/home/administrator/users';
export const ADMIN_USER_DETAILS = '/home/administrator/users/:id';
export const ADMIN_CATEGORY = '/home/administrator/categories';
export const ADMIN_CATEGORY_DETAILS = '/home/administrator/categories/:id';
export const DOWNLOAD_PAGE = '/home/downloads';

const routes = [
  {
    path: "/start",
    name: "Start",
    icon: "",
    component: Start,
    layout: "/home",
    isHidden: true
  },
  {
    path: "/login",
    name: "login",
    icon: "",
    component: SignInPage,
    layout: "/auth",
    isHidden: true
  },
  {
    path: "/register",
    name: "register",
    icon: "",
    component: SignUpPage,
    layout: "/auth",
    isHidden: true
  },
  {
    path: "/aboutme",
    name: "About Me",
    icon: "tim-icons icon-badge",
    component: Wizard,
    layout: "/home"
  },
  {
    path: "/projects",
    name: "My Projects",
    icon: "tim-icons icon-molecule-40",
    component: ProjectPage,
    layout: "/home"
  },
  {
    path: "/timeline",
    name: "Timeline",
    icon: "tim-icons icon-watch-time",
    component: Timeline,
    layout: "/home"
  },
  {
    path: "/guides",
    name: "Guides",
    icon: "tim-icons icon-zoom-split",
    component: Guides,
    layout: "/home"
  },
  {
    path: "/manageProjects",
    name: "Manage Projects",
    icon: "",
    component: AdminProjectPage,
    layout: "/auth",
    isHidden: true
  }, 

];
//!Abaddon.Babi.Charun12.
export default routes;
